void InitializeMathLookupTables(void)

{
  ulonglong arrayIndex;
  float *tablePointer;
  int compare_result;
  ulonglong tableSize;
  uint nextIndex;
  ulonglong loop_counter;
  int maxIterations;
  float *data_pointer;
  float calculatedValue;

  data_pointer = (float *)GRAPHICS_DATA_START_ADDR;
  loop_counter = 0;
  maxIterations = -3;
  tableSize = loop_counter;
  do {
    if (0 < (longlong)tableSize) {
      compare_result = -3;
      arrayIndex = loop_counter;
      tablePointer = data_pointer;
      do {
        calculatedValue = 0.0;
        if (-1 < (longlong)arrayIndex) {
          if ((longlong)arrayIndex < 3) {
            calculatedValue = 0.75;
          }
          else {
            calculatedValue = 1.0 - (float)compare_result / (float)maxIterations;
            calculatedValue = SQRT(calculatedValue) * calculatedValue;
          }
        }
        *tablePointer = calculatedValue;
        compare_result = compare_result + 1;
        tablePointer = tablePointer + 1;
        arrayIndex = arrayIndex + 1;
      } while ((longlong)arrayIndex < (longlong)tableSize);
    }
    maxIterations = maxIterations + 1;
    tableSize = tableSize + 1;
    data_pointer = data_pointer + SYSTEM_DATA_BLOCK_SIZE;
  } while ((longlong)data_pointer < GRAPHICS_DATA_END_ADDR);
  data_pointer = (float *)RENDER_DATA_START_ADDR;
  do {
    nextIndex = (int)loop_counter + 1;
    *data_pointer = 1.0 / SQRT((float)loop_counter) + 1.0 / SQRT((float)loop_counter);
    data_pointer = data_pointer + 1;
    loop_counter = (ulonglong)nextIndex;
  } while (nextIndex < SYSTEM_DATA_BLOCK_SIZE);
  return;
}
